import React, { useEffect } from 'react'
import { getAllTodos } from '../redux/actions';
import { useDispatch } from 'react-redux';


const Todos = () => {
const dispatch = useDispatch();
  useEffect(() =>{
    dispatch(getAllTodos());
  }, [])

  return (
    <div>Todos</div>
  )
}

export default Todos;
